import { Modal } from "react-bootstrap";
import { DayModalProps } from "../Interfaces/Day";

function DayModal({show, setShow}: DayModalProps) {
  const handleClose = () => setShow(false);

  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Body>
        <Modal.Title className="mb-3">Foo</Modal.Title>
      </Modal.Body>
    </Modal>
  );
}

export default DayModal;
